import React from 'react'
import ItemListContainer from '../ItemListContainer/ItemListContainer'

const Filtro = ({tipo = null}) => {
    return (
        <div>
            <ItemListContainer tipo={tipo}/>
        </div>
    )
}

export default Filtro
